import React, { useState } from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import SignUp from './Signup';
import FetchUserData from './FetchUserData';
import SignIn from './SignIn';
import ProtectedPage from './ProtectedPage';
import ProtectedRoute from './ProtectedRoute';

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false); // Manage auth state

  const handleLogin = () => setIsAuthenticated(true); // Simulate login
  const handleLogout = () => setIsAuthenticated(false); // Simulate logout

  return (
    <div>
      <nav>
        <Link to="/">Home</Link> | <Link to="/create-accountss">Create Account</Link> |{' '}
        <Link to="/fetch-user-data">Fetch User Data</Link> | <Link to="/SignIn">Sign In</Link> |{' '}
        <Link to="/ProtectedPage">Protected Page</Link> |{' '}
        {isAuthenticated ? (
          <button onClick={handleLogout}>Logout</button>
        ) : (
          <button onClick={handleLogin}>Login</button>
        )}
      </nav>
      <Routes>
        <Route path="/" element={<h1>Welcome to the App</h1>} />
        <Route path="/fetch-user-data" element={<FetchUserData />} />
        <Route path="/create-accountss" element={<SignUp />} />
        <Route path="/SignIn" element={<SignIn />} />
        <Route
          path="/ProtectedPage"
          element={
            <ProtectedRoute isAuthenticated={isAuthenticated}>
              <ProtectedPage />
            </ProtectedRoute>
          }
        />
      </Routes>
    </div>
  );
};

export default App;
